import React, { Component } from 'react';
import logo1 from './../../../assets/images/logo.png';

class logo extends Component {
    render() {
        return (
            <div>
                <img src={logo1} className="logo" />
                <center sty>"One Stop Tech Solution"</center>
            </div>
        );
    }
}

export default logo;
